import React, { useEffect } from 'react';
import './slideShow.css';

export default function SlideShow() {
    useEffect(() => {
        var $slider = $('.slideshow .slider');
        var maxItems = $('.item', $slider).length;
        var dragging = false;
        var tracking;
        var rightTracking;

        var $sliderRight = $('.slideshow').clone().addClass('slideshow-right').appendTo($('.split-slideshow'));

        var rightItems = $('.item', $sliderRight).toArray();
        var reverseItems = rightItems.reverse();
        $('.slider', $sliderRight).html('');
        for (var i = 0; i < maxItems; i++) {
            $(reverseItems[i]).appendTo($('.slider', $sliderRight));
        }

        $slider.addClass('slideshow-left');
        $('.slideshow-left').slick({
            vertical: true,
            verticalSwiping: true,
            arrows: false,
            infinite: true,
            dots: true,
            speed: 1000,
            cssEase: 'cubic-bezier(0.7, 0, 0.3, 1)'
        }).on('beforeChange', function (event, slick, currentSlide, nextSlide) {
            if (currentSlide > nextSlide && nextSlide === 0 && currentSlide === maxItems - 1) {
                $('.slideshow-right .slider').slick('slickGoTo', -1);
                $('.slideshow-text').slick('slickGoTo', maxItems);
            } else if (currentSlide < nextSlide && currentSlide === 0 && nextSlide === maxItems - 1) {
                $('.slideshow-right .slider').slick('slickGoTo', maxItems);
                $('.slideshow-text').slick('slickGoTo', -1);
            } else {
                $('.slideshow-right .slider').slick('slickGoTo', maxItems - 1 - nextSlide);
                $('.slideshow-text').slick('slickGoTo', nextSlide);
            }
        }).on('mousewheel', function (event) {
            event.preventDefault();
            if (event.deltaX > 0 || event.deltaY < 0) {
                $(this).slick('slickNext');
            } else if (event.deltaX < 0 || event.deltaY > 0) {
                $(this).slick('slickPrev');
            }
        }).on('mousedown touchstart', function () {
            dragging = true;
            tracking = $('.slick-track', $slider).css('transform');
            tracking = parseInt(tracking.split(',')[5]);
            rightTracking = $('.slideshow-right .slick-track').css('transform');
            rightTracking = parseInt(rightTracking.split(',')[5]);
        }).on('mousemove touchmove', function () {
            if (dragging) {
                var newTracking = $('.slideshow-left .slick-track').css('transform');
                newTracking = parseInt(newTracking.split(',')[5]);
                var diffTracking = newTracking - tracking;
                $('.slideshow-right .slick-track').css({ 'transform': 'matrix(1, 0, 0, 1, 0, ' + (rightTracking - diffTracking) + ')' });
            }
        }).on('mouseleave touchend mouseup', function () {
            dragging = false;
        });

        $('.slideshow-right .slider').slick({
            swipe: false,
            vertical: true,
            arrows: false,
            infinite: true,
            speed: 950,
            cssEase: 'cubic-bezier(0.7, 0, 0.3, 1)',
            initialSlide: maxItems - 1
        });

        $('.slideshow-text').slick({
            swipe: false,
            vertical: true,
            arrows: false,
            infinite: true,
            speed: 900,
            cssEase: 'cubic-bezier(0.7, 0, 0.3, 1)'
        });
    }, []);

    return (
        <div>
            <div className="split-slideshow">
                <div className="slideshow">
                    <div className="slider">
                        <div className="item">
                            <img src="https://raw.githubusercontent.com/supahfunk/supah-codepen/master/canyon-2.jpg" alt="Canyon 2" />
                        </div>
                        <div className="item">
                            <img src="https://raw.githubusercontent.com/supahfunk/supah-codepen/master/canyon-3.jpg" alt="Canyon 3" />
                        </div>
                        <div className="item">
                            <img src="https://raw.githubusercontent.com/supahfunk/supah-codepen/master/canyon-4.jpg" alt="Canyon 4" />
                        </div>
                        <div className="item">
                            <img src="https://raw.githubusercontent.com/supahfunk/supah-codepen/master/canyon-1.jpg" alt="Canyon 1" />
                        </div>
                    </div>
                </div>
                <div className="slideshow-text">
                    <div className="item">Canyon</div>
                    <div className="item">Desert</div>
                    <div className="item">Erosion</div>
                    <div className="item">Shape</div>
                </div>
            </div>
            <a className="the-most" target="_blank" href="https://codepen.io/2017/popular/pens/10/">
                <img src="https://raw.githubusercontent.com/supahfunk/supah-codepen/master/themost-2017.png" alt="The Most" />
            </a>
            Resources
        </div>
    );
}
